import React, { useCallback, useState } from 'react'

import { useQueryClient } from 'react-query'

import { Box, InputAdornment, InputBase, Typography } from '@mui/material'
import { DataGrid } from '@mui/x-data-grid'
import SearchIcon from '@mui/icons-material/Search'
import { Search } from '../../components'

import debounce from 'lodash.debounce'

const StyledDataGrid = styled(DataGrid)(({ theme }) => ({
  border: 0,
  color:
    theme.palette.mode === 'light' ? 'rgba(0,0,0,.85)' : 'rgba(255,255,255,0.85)',
  fontFamily: [
    '-apple-system',
    'BlinkMacSystemFont',
    '"Segoe UI"',
    'Roboto',
    '"Helvetica Neue"',
    'Arial',
    'sans-serif',
    '"Apple Color Emoji"',
    '"Segoe UI Emoji"',
    '"Segoe UI Symbol"',
  ].join(','),
  WebkitFontSmoothing: 'auto',
  letterSpacing: 'normal',
  '& .MuiDataGrid-columnsContainer': {
    backgroundColor: theme.palette.mode === 'light' ? '#fafafa' : '#1d1d1d',
  },
  '& .MuiDataGrid-iconSeparator': {
    display: 'none',
  },
  '& .MuiDataGrid-columnHeader, .MuiDataGrid-cell': {
    borderRight: `1px solid ${
      theme.palette.mode === 'light' ? '#f0f0f0' : '#303030'
    }`,
  },
  '& .MuiDataGrid-columnsContainer, .MuiDataGrid-cell': {
    borderBottom: `1px solid ${
      theme.palette.mode === 'light' ? '#f0f0f0' : '#303030'
    }`,
  },
  '& .MuiDataGrid-cell': {
    color:
      theme.palette.mode === 'light' ? 'rgba(0,0,0,.85)' : 'rgba(255,255,255,0.65)',
  },
  '& .MuiPaginationItem-root': {
    borderRadius: 0,
  }
}));

export default function Tracks () {
  // const queryClient = useQueryClient()
  // const queryName = 'trackData'

  const [search, setSearch] = useState('')

  // const refetch = () => queryClient.invalidateQueries(queryName)
  // const debouncedTrackSearch = useCallback(debounce(refetch, 400), [])
  const handleTrackSearch = (event) => {
    setSearch(event.target.value)
    // debouncedTrackSearch(event.target.value)
  }
  const data = [
    {
      id: 10,
      title:'blah',
      albumId:10,
      mediaTypeId:10,
      genreId: 10,
      composer: 'balh',
      duration: 100,
      size: 100,
      price:10
    }
  ]

  const columns = [
    { field: 'id', hide: true},
    {
      field: 'title',
      headerName: 'Title'
    },
    { field: 'albumId', hide: true},
    { field: 'mediaTypeId', hide: true},
    { field: 'genreId', hide: true},
    { field: 'composer', hide: true},
    {
      field: 'duration',
      headerName: 'Duration'
    },
    {
      field: 'size',
      headerName: 'Size'
    },
    { field: 'price', hide: true}
  ]

  return (
    <Box display="flex" flexDirection="column" flexGrow={1}>
      <Box my={2}>
        <Typography variant="h3">Tracks</Typography>
      </Box>
      <Box my={2} sx={{ backgroundColor: 'white', borderRadius: '4px' }}>
        <Search
          value={search || ''}
          onChange={handleTrackSearch}
        />
      </Box>
      <Box height={500}>
        <DataGrid
          columns={columns}
          rows={data}
        />
      </Box>
    </Box>
  )
}
